import{_ as e,c as a,o as s,a4 as o}from"./chunks/framework.Bdh9hNeQ.js";const i="/assets/ascreenshot_74da4b264ac047a9b385e94a084ec308_text_export.kox2sdYg.jpeg",n="/assets/ascreenshot_4e0c45dc30744161a0aea69acc2ba701_text_export.PHc-64k3.jpeg",r="/assets/ascreenshot_548d2f94e5d84656a8c9e0d196cf8f47_text_export.DGtFRQgW.jpeg",c="/assets/ascreenshot_15d0b8cb44234812a532aa222803b930_text_export.DlO12vyQ.jpeg",l="/assets/ascreenshot_c1fd4fb57cb247fd93597311789e2f5e_text_export.C2qsfWJh.jpeg",p="/assets/ascreenshot_4d5f94dd5cfc4523a2773aedd49b9b17_text_export.CowxaGx4.jpeg",d="/assets/ascreenshot_2cbb3520281e4699ab43fae239984f93_text_export.B1ojWXtn.jpeg",h="/assets/ascreenshot_bf75c6f0060a44eebda5e518d3364b8d_text_export.eOjQ63z3.jpeg",_="/assets/ascreenshot_37ac91f3dc4c4373804b8932456c818b_text_export.xch63PR_.jpeg",u="/assets/ascreenshot_2d497270fa0c4df7b10593e347209f8a_text_export.yQaAn9Ja.jpeg",m="/assets/ascreenshot_32ba1d266e6a45b8aad76bd288507805_text_export.GsQWDDw0.jpeg",f="/assets/ascreenshot_213c8d4bb9264a2185429f7812a25973_text_export.lhfjgzig.jpeg",g="/assets/ascreenshot_617f2a704d2d4b7fa9d4034aa965f4e8_text_export.DHpmnX-I.jpeg",b="/assets/ascreenshot_f93c5de44c9448bf91af36b205cdcc17_text_export.CHujCQl_.jpeg",x="/assets/ascreenshot_8e15689d8030447fb77a6ae42f0dc967_text_export.BfrER5Gz.jpeg",I=JSON.parse('{"title":"B. Data Visualization and Analysis","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/data_visualisation.md","filePath":"tutorials/data_visualisation.md"}'),y={name:"tutorials/data_visualisation.md"};function w(v,t,S,q,j,A){return s(),a("div",null,[...t[0]||(t[0]=[o('<h1 id="b-data-visualization-and-analysis" tabindex="-1">B. Data Visualization and Analysis <a class="header-anchor" href="#b-data-visualization-and-analysis" aria-label="Permalink to &quot;B. Data Visualization and Analysis&quot;">â€‹</a></h1><p>The primary purpose of the CIF Dashboard is to allow users to visualize data and intereact with them. The data can come from external sources, from the CIF internal storage, or be calculated on-the-fly using parameters selected by users.</p><p>1. Current CIF data holdings include:</p><ul><li>Satellite data</li><li>Sea ice</li><li>Icebergs</li><li>Sea water</li><li>Water biology</li><li>Water chemistry</li><li>Waves</li><li>Wind</li><li>Bathymetry</li></ul><p>Most of the data is global, with a focus on the North Atlantic and Arctic oceans. There is also data specific to the Baltic Sea and Antarctica.</p><p>Most of the data can be analyzed statistically.</p><p>2. There are a few types of satellite data available.</p><p><img src="'+i+'" alt=""></p><p>3. Radarasat Constellation Mission (RCM) and Sentinel 1 are Synthetic Aperature Radar (SAR) satellites that can see in the dark and through clouds. For Sentinel 1, EW HH means Extra Wide swath mode and Horizontal polarization for both transmit and receive. IW VV means Interferometric Wide swath mode and Verticle polarization for both transmit and receive.</p><p><img src="'+n+'" alt=""></p><p>4. Sentinel 2 is an optical satellite. L2A indicates the level of processing of the image.</p><p><img src="'+r+'" alt=""></p><p>5. Sea Ice Speed is an example of vector data.</p><p><img src="'+c+'" alt=""></p><p>6. Vector data is illustrated as a combination of a colour, indicating magnitude, and an arrow, indicating direction.</p><p><img src="'+l+'" alt=""></p><p>7. There are often a variety of approaches to get the same information. For example, sea ice concentration can be determined from passive microwave satellite data, by human analysts interpreting SAR satellite data (see various ice charts), and through artificial intelligence interpretation of SAR satellite data.</p><p><img src="'+p+'" alt=""></p><p>8. Here is an example of sea ice concentration determined by AI interpretation of SAR satellite data.</p><p><img src="'+d+'" alt=""></p><p>9. When data variables are suitable for statistical analysis, a menu box will appear in the bottom right corner. Here is an example of the statistical analysis capabilities of the CIF Dashboard.</p><p>Using the &quot;Select Indictor&quot; button, choose Sentinel 2 L2A satellite data.</p><p>Using the calendar at the bottom of the map, choose 20 August 2025.</p><p>Pan and zoom to the fiord on the east coast of Greenland shown below.</p><p><img src="'+h+'" alt=""></p><p>10. In this image, glaciers flowing into the fiord can be clearly seen, along with the icebergs floating in the fiord that have calved off the glaciers.</p><p><img src="'+_+'" alt=""></p><p>11. Next, use the &quot;Select Indicator&quot; button to choose &quot;Sea Water Salinity&quot; data.</p><p><img src="'+u+'" alt=""></p><p>12. Use the &quot;Select area on map&quot; tool to draw a bounding box at the outlet of the fiords.</p><p><img src="'+m+'" alt=""></p><p>13. Use the &quot;Select start date&quot; and &quot;Select end date&quot; boxes to choose one year&#39;s data from 1 January to 31 December 2025 and then click &quot;Execute&quot;.</p><p><img src="'+f+'" alt=""></p><p>14. After a short processing time, the statistical analysis results are shown in the window. The arrows at the top right of the graph can be used to enlarge it.</p><p><img src="'+g+'" alt=""></p><p>15. The graph shows salinity over the area of the bounding box across time. The mean is the black line and the upper and lower bounds are shown in orange and blue, respectively. Hovering the cursor over the graph brings up a box showing the statistics for any time.</p><p>It can be seen that the salinity is lowest in July when the glacier melt is at its maximum and fresh water from the glaciers is flowing into the fiord.</p><p><img src="'+b+'" alt=""></p><p>16. The process can be repeated for another area or time by using the &quot;Delete&quot; area button, drawing a new bounding box, adjusting the dates, and clicking &quot;Execute&quot; again.</p><p><img src="'+x+'" alt=""></p><p>17. Return to the Dashboard &lt;Link&gt;</p><p>Return to the Tutorial Contents &lt;Link&gt;</p><p>Continue to the next Tutorial &lt;Link&gt;</p>',43)])])}const C=e(y,[["render",w]]);export{I as __pageData,C as default};
